import React, { useState, useEffect } from 'react'

type Props = {
    label?: string;
};

export function Post (props: Props) {
  const [count, setCount] = useState(0)
  const { label } = props

  useEffect(() => {
    // サーバーアクセスなどのマウント後に実行したいコードはここ
    return () => {
      // 削除前に実行したいコードはここ
    }
  }, [])

  function onClick () {
    setCount(count + 1)
  }

  return (
        <div className="panel">
            <div className="message">
                <button onClick={onClick}>{label}</button>
            </div>
        </div>
  )
}

Post.defaultProps = {
  label: '押して下さい'
}
